import { gql } from '@apollo/client';

export const GET_RATE_INFO = gql`
    query getRateInfo($id: String) {
        getRateInfo(id: $id) {
            id,
            symbol,
            currencySymbol,
            rateUsd
        }
    }
`;

export const GET_RATE = gql`
    query getRateInfo($id: String) {
        getRateInfo(id: $id) {
            rateUsd
        }
}
`;

export const GET_ALL_RATES_INFO = gql`
    query {
        getAllRatesInfo {
            id,
            symbol,
            currencySymbol,
            rateUsd
        }
    }
`;
